                }
            ]
        });
</code></pre>

<p><strong>RiTest.ts</strong></p>

<pre><code>import * as mongoose from 'mongoose';

const Scheme = mongoose.Schema;

export const RiTestScheme = new Scheme({
    novelName: String,
    novelAuthor: String,
    novelCoverArt: String,
    novelTags: Array,
    chapters: [
        {
            id: Number,
            title: String,
            content: String,
            authorNotes: String
        }
    ]
});

export class RiTestController {
    public addChapter(callback: (data) =&gt; void) {
        var chapterInfoModel = mongoose.model('ChaptersTest', RiTestScheme);

        var array = [
        {
            chapter: [
                {
                    id: 0,
                    title: 'prolog',
                    content: 'conetntt is empty',
                    authorNotes: 'nothing is said by author'
                },
                {
                    id: 1,
                    title: 'making a sword',
                    content: 'mine craft end chapter',
                    authorNotes: 'nothing'
                }
            ]
        }
    ];

        let newChapterInfo = new chapterInfoModel(array);

        newChapterInfo.save((err, book) =&gt; {
            if (err) {
                return callback(err);
            } else if (!err) {
                return callback(book);
            }
        });
    }
}
</code></pre>

<p>This doesn't work, <code>var array</code> doesn't get saved into <code>let newChapterInfo = new chapterInfoModel(array);</code> what I am trying to do add another chapter to <code>array.chapter</code> but the array doesn't get recognized in the <code>chapterInfoModel()</code> how would I fix this array and add an item to the array to create a new entry into this existing collection</p>

