<pre><code>{
  "observation": {
    "temporalExtent": [
      {
        "dateBeg": ISODate("2002-07-28T20:47:00.000+02:00"),
        "dateEnd": ISODate("2003-09-13T16:17:00.000+02:00")
      }
    ]
  }
}
</code></pre>

<p>I'm trying to make the following aggregation operation that should return the document above but I can't figure out what's wrong and why the document is not found.</p>

<pre><code>db.collection.aggregate({
  "$match": {
    "observation.temporalExtent": {
      "$elemMatch": {
        "dateBeg": {
          "$gte": {
            "$dateFromString": {
              "dateString": "1892-01-05T23:50:39.000Z"
            }
          }
        }
