mongoose model has no access to connections in-progress transactions<p>In my current express application I want to use the new ability of mongodb multi-doc transactions.</p>

<p>First of all it is important to point out how I connect and handle the models</p>

<p>My app.js (server) firstly connects to the db by using db.connect(). </p>

<p>I require all models in my db.index file. Since the models will be initiated with the same mongoose reference, I assume that future requires of the models in different routes point to the connected and same connection. Please correct me if I'm wrong with any of these assumptions.</p>

<p>I save the connection reference inside the state object and returning it when needed for my transaction later</p>

<p><strong>./db/index.ts</strong></p>

<pre><code>const fs       = require('fs');
const path     = require('path');
const mongoose = require('mongoose');

const state = {
 connection = null,
}

// require all models
const modelFiles = fs.readdirSync(path.join(__dirname, 'models'));
modelFiles
.filter(fn =&gt; fn.endsWith('.js') &amp;&amp; fn !== 'index.js')
.forEach(fn =&gt; require(path.join(__dirname, 'models', fn)));

const connect = async () =&gt; {
  state.connection = await mongoose.connect(.....);
  return;
}

const get = () =&gt; state.connection; 

module.exports = {
 connect,
 get,
}
</code></pre>

<p>my model files are containing my required schemas</p>

<p><strong>./db/models/example.model.ts</strong></p>

<pre><code>const mongoose   = require('mongoose');
const Schema     = mongoose.Schema;
const ExampleSchema = new Schema({...);

const ExampleModel = mongoose.model('Example', ExampleSchema);
module.exports  = ExampleModel;
</code></pre>

<p>Now the route where I try to do a basic transaction. F</p>

<p><strong>./routes/item.route.ts</strong></p>

<pre><code>const ExampleModel = require('../db/models/example.model');

router.post('/changeQty', async (req,res,next) =&gt; {

  const connection = db.get().connection;
  const session = await connection.startSession(); // works fine

  // start a transaction
  session.startTransaction(); // also fine

  const {someData} = req.body.data;

  try{

     // jsut looping that data and preparing the promises
     let promiseArr = [];
     someData.forEach(data =&gt; {
        // !!! THIS TRHOWS ERROR !!!
        let p = ExampleModel.findOneAndUpdate(
          {_id : data.id},
          {$incr : {qty : data.qty}},
          {new : true, runValidators : true}
        ).session(session).exec();
        promiseArr.push(p);
     })        

     // running the promises parallel
     await Promise.all(promiseArr);

     await session.commitTransaction();

    return res.status(..)....;

  }catch(err){
     await session.abortTransaction();
    // MongoError : Given transaction number 1 does not match any in-progress transactions.
    return res.status(500).json({err : err}); 
  }finally{
    session.endSession();
  }

})
</code></pre>

<p>But I always get the following error, which probably has to do sth with the connection reference of my models. I assume, that they don't have access to the connection which started the session, so they are not aware of the session.</p>

<blockquote>
  <p>MongoError: Given transaction number 1 does not match any in-progress
  transactions.</p>
</blockquote>

<p>Maybe I somehow need to initiate the models inside db.connect with the direct connection reference ?</p>

<p>There is a big mistake somewhere and I hope you can lead me to the correct path. I appreciate Any help, Thanks in advance</p>

